import React, { Component } from 'react';
import Vehicle from './Vehicle'

let make = location.pathname.split('/')[1];
let model = location.pathname.split('/')[2];
class VehiclesList extends Component {


    state = {
      vehicles: []
    }

    componentDidMount() {
      this.getVehicles()
    }

    getVehicles = () => {
      fetch(`http://localhost:8080/api/vehicles?make=${this.props.make}&model=${this.props.model}`)
      .then(res => res.json())
      .then(data => this.setState({
        vehicles: data
      }))
    }

    render() {
      console.log(this.props.make);
      const { vehicles } = this.state
      return (
        <div>
        List of Vehicles
          <ul>
          {
            vehicles.map((vehicle, id) => {
              return <Vehicle key={id} vehicle={vehicle} />
            })
          }
          </ul>
        </div>
      );
    }

  }

export default VehiclesList;
